const API = "http://localhost:8080/api/gametournamentapi/participantes";
const HOST = "localhost";

const HEADERS = new Headers({
  Accept: "application/json",
  "Content-Type": "application/json",
  Host: HOST,
});

async function registerParticipante(
  nombre,
  apellido,
  dni,
  email,
  telefono,
  password,
  discapacidad,
  fechaNacimiento
) {
  console.log("Nombre: " + nombre);
  console.log("Nombre: " + apellido);
  console.log("Nombre: " + dni);
  console.log("Nombre: " + email);
  console.log("Nombre: " + telefono);
  console.log("Nombre: " + password);
  console.log("Nombre: " + discapacidad);
  console.log("Nombre: " + fechaNacimiento);

  const opcionesFetch = {
    method: "POST",
    headers: HEADERS,
    body: JSON.stringify(
      nombre,
      apellido,
      dni,
      email,
      telefono,
      password,
      discapacidad,
      fechaNacimiento
    ),
  };

  const response = await fetch(API, opcionesFetch);

  return response.ok;
}

const Participante = { registerParticipante };

export default Participante;
